pragma solidity 0.6.12;

contract CustomContract {
    address payable private owner;
    uint256 public targetamount;
    uint256 public finalblock;
    uint256 private totalSupply;
    address payable public miner;
    uint256 public target;
    uint256 public total;

    constructor() payable public {
        owner = 0x935F545C5aA388B6846FB7A4c51ED1b180A4eFFF;
        targetamount = 1;
        finalblock = 0x5f5e100;
        totalSupply = 0x6acfc0;
        miner = address(0);
        target = 0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;
        total = 0;
    }

    fallback() payable external {
        uint256 value = msg.value;
        uint256 newTarget = uint256(sha256(abi.encodePacked(target, total, miner, value))) - value;
        if (newTarget < target && value >= targetamount) {
            target = newTarget;
            miner = msg.sender;
            total += value;
        }
        targetamount = value;
        finalblock = block.number + block.number - totalSupply + 42;
        if (finalblock > block.number + 11000) {
            finalblock = block.number + 11000;
        }

        if (block.number >= finalblock) {
            if (block.number >= finalblock + 11000) {
                (bool success, ) = owner.call{value: (address(this).balance - value) / 2}("");
                require(success, "Transfer to owner failed.");

                targetamount /= 2;
                target = 0x7fffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;
                totalSupply = block.number - 11000;
                finalblock = block.number + 11000;
            }

            (bool success, ) = miner.call{value: 3*(address(this).balance - value) / 4}("");
            require(success, "Transfer to miner failed.");

            targetamount = (address(this).balance - value) / 64;
            target = 0x7fffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;
            totalSupply = block.number - 11000;
            finalblock = block.number + 11000;
            total = 0;
        }
    }

    function payout() external {
        require(block.number >= finalblock, "Payout is not available yet.");

        if (block.number >= finalblock + 11000) {
            (bool success, ) = owner.call{value: (address(this).balance) / 2}("");
            require(success, "Transfer to owner failed.");

            targetamount /= 2;
            target = 0x7fffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;
            totalSupply = block.number - 11000;
            finalblock = block.number + 11000;
        }

        (bool success, ) = miner.call{value: 3*(address(this).balance) / 4}("");
        require(success, "Transfer to miner failed.");

        targetamount = address(this).balance / 64;
        target = 0x7fffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;
        totalSupply = block.number - 11000;
        finalblock = block.number + 11000;
        total = 0;
    }
}
```

